import React from 'react';
import { ListItem, ListItemText, Button, Box } from '@mui/material';

const ReadingListItem = ({ book, onRemove }) => (
  <ListItem>
    <Box flexGrow={1}>
      <ListItemText
        primary={book.title}
        secondary={book.author}
      />
    </Box>
    <Button variant="contained" color="secondary" onClick={onRemove}>
      Remove
    </Button>
  </ListItem>
);

export default ReadingListItem;
